import React from 'react';
import { createMaterialTopTabNavigator } from '@react-navigation/material-top-tabs';
import {ChatStackScreen} from '../NavigationScreen'
import { NotificationScreen, ListUserChatScreen } from '../ScreemFolder/NotificationScreen';

const Tab = createMaterialTopTabNavigator();

function SearchStackScreen() {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Story" component={NotificationScreen} />
      <Tab.Screen name="User" component={ListUserChatScreen} />
      <Tab.Screen name="List Story" component={ListUserChatScreen} />
    </Tab.Navigator>
  );
} export {SearchStackScreen}
